import React from "react";
import { Routes, Route } from "react-router-dom";
import Login from "../Views/Login/Login";
import Signup from "../Views/Signup/Signup";

function ProtectedRoutes() {
  return (
    <div>
      <Routes>
        <Route path="/login">
          <Login />
        </Route>
        <Route path="/signup">
          <Signup />
        </Route>
      </Routes>
    </div>
  );
}

export default ProtectedRoutes;
